import React from "react";
import { Footer } from "./components/Footer";
import { Header } from "./components/Header";

function App() {
    // const books = [
    //     {
    //         title: "Northanger Abbey",
    //         author: "Austen, Jane",
    //         year: 1814,
    //         edition: "Penguin",
    //         price: 18.2,
    //     },
    //     {
