    //         author: "Woolf, Virginia",
    //         year: 1925,
    //         edition: "Harcourt Brace",
    //         price: 25,
    //     },
    //     {
    //         title: "The Hours",
    //         author: "Cunnningham, Michael",
    //         year: 1999,
    //         edition: "Harcourt Brace",
    //         price: 12.35,
    //     },
    //     {
    //         title: "Huckleberry Finn",
    //         author: "Twain, Mark",
    //         year: 1865,
    //         edition: "Penguin",
    //         price: 5.76,
    //     },
    //     {
    //         title: "Bleak House",
    //         author: "Dickens, Charles",
    //         year: 1870,
    //         edition: "Random House",
    //         price: 5.75,
    //     },
    //     {
    //         title: "Tom Sawyer",
    //         author: "Twain, Mark",
    //         year: 1862,
    //         edition: "Random House",
    //         price: 7.75,
    //     },
    //     {
    //         title: "A Room of One's Own",
    //         author: "Woolf, Virginia",
    //         year: 1922,
    //         edition: "Penguin",
    //         price: 29,
    //     },
    //     {
    //         title: "Harry Potter",
    //         author: "Rowling, J.K.",
    //         year: 2000,
    //         edition: "Harcourt Brace",
    //         price: 19.95,
    //     },
    //     {
    //         title: "One Hundred Years of Solitude",
    //         author: "Marquez",
    //         year: 1967,
    //         edition: "Harper  Perennial",
    //         price: 14.0,
    //     },
    //     {
    //         title: "Hamlet, Prince of Denmark",
    //         author: "Shakespeare",
    //         year: 1603,
    //         edition: "Signet  Classics",
    //         price: 7.95,
    //     },
    //     {
    //         title: "Lord of the Rings",
    //         author: "Tolkien, J.R.",
    //         year: 1937,
    //         edition: "Penguin",
    //         price: 27.45,
    //     },
    // ];
    return (
        <div className="App">
            <Header/>
            <main className="main">
                <section className="todo-list-container">
                    <h1>Todo List</h1>

                    <div className="add-btn-container">
                        <button className="btn">+ Add new Todo</button>
                    </div>

                    <div className="table-wrapper">
                        <div className="loading-container">
                            <div className="loading-spinner">
                                <span className="loading-spinner-text">
                                    Loading
                                </span>
                            </div>
                        </div>

                        <table className="table">
                            <thead>
                                <tr>
                                    <th className="table-header-task">Task</th>
                                    <th className="table-header-status">
                                        Status
                                    </th>
                                    <th className="table-header-action">
                                        Action
                                    </th>
                                </tr>
                            </thead>
                            <tbody>
                                <tr className="todo is-completed">
                                    <td>Give dog a bath</td>
                                    <td>Complete</td>
                                    <td className="todo-action">
                                        <button className="btn todo-btn">
                                            Change status
                                        </button>
                                    </td>
                                </tr>

                                <tr className="todo is-completed">
                                    <td>Do laundry</td>
                                    <td>Complete</td>
                                    <td className="todo-action">
                                        <button className="btn todo-btn">
                                            Change status
                                        </button>
                                    </td>
                                </tr>

                                <tr className="todo">
                                    <td>Vacuum floor</td>
                                    <td>Incomplete</td>
                                    <td className="todo-action">
                                        <button className="btn todo-btn">
                                            Change status
                                        </button>
                                    </td>
                                </tr>

                                <tr className="todo is-completed">
                                    <td>Feed cat</td>
                                    <td>Complete</td>
                                    <td className="todo-action">
                                        <button className="btn todo-btn">
                                            Change status
                                        </button>
                                    </td>
                                </tr>

                                <tr className="todo">
                                    <td>Change light bulbs</td>
                                    <td>Incomplete</td>
                                    <td className="todo-action">
                                        <button className="btn todo-btn">
                                            Change status
                                        </button>
                                    </td>
                                </tr>

                                <tr className="todo is-completed">
                                    <td>Feed cat</td>
                                    <td>Complete</td>
                                    <td className="todo-action">
                                        <button className="btn todo-btn">
                                            Change status
                                        </button>
                                    </td>
                                </tr>

                                <tr className="todo">
                                    <td>Change light bulbs</td>
                                    <td>Incomplete</td>
                                    <td className="todo-action">
                                        <button className="btn todo-btn">
                                            Change status
                                        </button>
                                    </td>
                                </tr>

                                <tr className="todo is-completed">
                                    <td>Go to Store</td>
                                    <td>Completed</td>
                                    <td className="todo-action">
                                        <button className="btn todo-btn">
                                            Change status
                                        </button>
                                    </td>
                                </tr>

                                <tr className="todo">
                                    <td>Fill gas tank</td>
                                    <td>Incomplete</td>
                                    <td className="todo-action">
                                        <button className="btn todo-btn">
                                            Change status
                                        </button>
                                    </td>
                                </tr>
                            </tbody>
                        </table>
                    </div>
                </section>
            </main>
            <Footer />
        </div>
    );
}

export default App;
